import React from "react";
import {Col, FormGroup, Label, Modal, ModalBody, ModalHeader} from "reactstrap";
import Translate from "../../../Translate";

const CurrencyModal = props => {

    return (
        <Modal isOpen={props.isOpen}>
            <ModalHeader>
                <Translate name={'editCurrency'}/>
            </ModalHeader>
            <ModalBody>
                <form>
                    <FormGroup row>
                        <Label for={'name'} sm={3}>
                            <Translate name={'name'}/>

                        </Label>
                        <Col sm={7} className={'pr-0'}>
                            <input
                                id={'name'}
                                type={'text'}
                                className='form-control square'
                                name={'name'}
                                value={''}
                            />
                        </Col>
                    </FormGroup>

                    <FormGroup row>
                        <Label for={'short'} sm={3}>
                            <Translate name={'short'}/>

                        </Label>
                        <Col sm={7} className={'pr-0'}>
                            <input
                                id={'short'}
                                type={'text'}
                                name={'short'}
                                className='form-control square'
                                value={''}
                            />
                        </Col>
                    </FormGroup>

                    <FormGroup row>
                        <Label for={'value'} sm={3}>
                            <Translate name={'value'}/>

                        </Label>
                        <Col sm={7} className={'pr-0'}>
                            <input
                                id={'value'}
                                type={'number'}
                                name={'value'}
                                className='form-control square'
                                value={''}
                            />
                        </Col>
                    </FormGroup>
                </form>
            </ModalBody>
        </Modal>
    )
}

export default CurrencyModal
